INSERT INTO `m_dewan_komisaris` (`id`, `title`, `title_en`, `nama`, `jabatan`, `jabatan_en`, `keterangan`, `keterangan_en`, `photo`, `created_at`, `updated_at`) VALUES
(1, NULL, NULL, 'Dr. Toto Pranoto, CRGP', 'Komisaris Utama', 'President Commissioner', 'Lahir di Bandung 17 Mei 1966. Meraih gelar Sarjana dari FEUI tahun 1993 \r\ndengan major Accounting. Mendapatkan gelar Magister Manajemen dari \r\nProgram MMUI pada 1999 dengan major pada Finance. Meraih gelar S3 dalam \r\nbidang Public  Policy &amp; Administration dari UI pada 2011. Saat ini \r\njuga menjabat sebagai Managing Director LM FEB UI (2009- Sekarang) dan \r\nAnggota Komite Infrastruktur KEIN sejak 2017.', 'Lahir di Bandung 17 Mei 1966. Meraih gelar Sarjana dari FEUI tahun 1993 \r\ndengan major Accounting. Mendapatkan gelar Magister Manajemen dari \r\nProgram MMUI pada 1999 dengan major pada Finance. Meraih gelar S3 dalam \r\nbidang Public  Policy &amp; Administration dari UI pada 2011. Saat ini \r\njuga menjabat sebagai Managing Director LM FEB UI (2009- Sekarang) dan \r\nAnggota Komite Infrastruktur KEIN sejak 2017.', 'dewan_komisaris_image/20200207170313DKM_20180124-133650.png', '2020-02-07 10:03:13', '2020-02-07 10:03:13'),
(2, NULL, NULL, 'Raymond Buisson, SE, CRGP', 'Komisaris Independen', 'Independent Commissioner', 'Lahir di Semarang tanggal 1 April 1960. Menempuh pendidikan\r\nAhli Administrasi Perusahaan, Jurusan Administrasi Keuangan dari\r\nUniversitas Diponegoro, Semarang, Jawa Tengah tahun 1982, serta\r\nmemperoleh gelar Strata 1 (S1) Manajemen Keuangan dari Fakultas\r\nEkonomi Mpu Tantular, Jakarta tahun 2000. Pernah bertugas pada\r\nbagian akunting dan keuangan dibeberapa Perusahaan. Menjabat\r\nsebagai Direktur Jakarta Insurance Institute (2002-Juli 2010), Anggota\r\nKomite Audit PT Asuransi Jasa Tania, Tbk. (Januari 2004-31 Desember\r\n2006), Anggota Komite Audit PT Asuransi Jasa Tania, Tbk. (Januari\r\n2007-31 Desember 2010). Menjabat sebagai Komisaris Independen\r\nPT Reasuransi Nasional Indonesia (Juni 2012-sekarang).', 'Born in Semarang on April 1, 1960. He earned his education in the\r\nCorporate Administration Expert, majoring Financial Administration\r\nfrom University Diponegoro, Semarang, Central Java, in 1982, and\r\nBachelor Degree in Financial Management from Faculty of Economy\r\nof University of Mpu Tantular, Jakarta in 2000. He once served in\r\nmany companies in the accounting and financial division. He was the\r\nDirector at Jakarta Insurance institute (2002-July 2010), Member of\r\nthe Audit Committee at PT Asuransi Jasa Tania, Tbk. (January 2004-\r\nDecember 31, 2006), Member of Audit Committee at PT Asuransi\r\nJasa Tania, Tbk. (January 2007- December 31, 2010). He serves as\r\nan Independent Commissioner at PT Reasuransi Nasional Indonesia\r\n(June 2012- now).', 'dewan_komisaris_image/20200207170453DKM_20160201-111642.jpg', '2020-02-07 10:04:53', '2020-02-07 10:04:53'),
(3, NULL, NULL, 'Dwi Agus Sumarsono *', 'Komisaris', 'Commissioner', 'Lahir di Ngawi tanggal 31 Mei 1968  memperoleh gelar Strata 1 (S1) \r\nSarjana Ekonomi dari Universitas Merdeka Malang, Jawa Timur tahun 1991, \r\nserta  melanjutkan Pascasarjana Manajemen di STIE Mitra Indonesia \r\nYogyakarta (2002). Menjabat sebagai Kepala Divisi Asuransi Uang PT \r\nAsuransi Jasa Indonesia (Persero) tahun 2013  2016. Kemudian ditetapkan\r\n sebagai Direktur Pemasaran PT Asuransi Kredit Indonesia (Persero) \r\nberdasarkan Surat Keputusan Menteri Badan Usaha Milik Negara Republik \r\nIndonesia Selaku Pemegang Saham No. S-203/S.MBU.3/09/2016 tanggal 9 \r\nSeptember 2016, yang pada akhirnya menjadi Direktur Operasional \r\nKomersil. Ditunjuk sebagai Komisaris PT Reasuransi Nasional Indonesia \r\nberdasarkan Rapat Umum Pemegang Saham Luar Biasa (RUPSLB) PT Reasuransi \r\nNasional Indoensia tanggal 10 September 2019.<br>\r\n<small><i>*) Masih dalam tahap Fit and Proper Test OJK</i></small>', 'Born in Ngawi on May 31, 1968, earned a Bachelor degree (S1) in \r\nEconomics from Merdeka University of Malang, East Java in 1991, and \r\nearned a Master degree in Management at STIE Mitra Indonesia Yogyakarta \r\n(2002). Served as Head of Money Insurance Division of PT Asuransi Jasa \r\nIndonesia (Persero) from 2013 to 2016. Then, appointed as Marketing \r\nDirector cbased on the Decree of the Minister of State-Owned Enterprises\r\n of the Republic of Indonesia as Shareholder No. S-203 / S.MBU.3 / \r\n09/2016 dated September 9, 2016, which eventually became the Commercial \r\nOperations Director of PT Asuransi Jasa Indonesia (Persero). Appointed \r\nas the Commissioner of PT Reasuransi Nasional Indonesia based on the \r\nExtraordinary General Meeting of Shareholders (EGMS) of PT Reasuransi \r\nNasional Indonesia on September 10, 2019.<br>\r\n<small><i>*) Still in Fit and Proper Test OJK</i></small>', 'dewan_komisaris_image/20200217160935DKM_20191003-110246.jpg', '2020-02-17 09:09:35', '2020-02-17 09:09:35');

