INSERT INTO `m_dewan_pengawas_syariah` (`id`, `title`, `title_en`, `nama`, `jabatan`, `jabatan_en`, `keterangan`, `keterangan_en`, `photo`, `created_at`, `updated_at`) VALUES
(1, NULL, NULL, 'Ir. Muhammad Syakir Sula, AAIJ, FIIS', 'Ketua', 'Chief', 'Lahir di Palopo Sulawesi Selatan, 12 Pebruari 1964. Meraih gelar Sarjana\r\n (S1) dari Universitas Padjajaran tahun 1989. Beliau pernah berkarir \r\nmenjadi Kepala Divisi PT Asuransi Takaful Keluarga (1995-1999), Direktur\r\n Teknik PT Asuransi Takaful Umum (2000-2003), Direktur Marketing PT. \r\nAsuransi Takaful Group (2003-2006), dan Asisten Direktur Bank Muamalat \r\nIndonesia (2006-2008). Bergabung dan menjabat sebagai Ketua Dewan \r\nPengawas Syariah PT Reasuransi Nasional Indonesia sejak tahun 2013.', 'Lahir di Palopo Sulawesi Selatan, 12 Pebruari 1964. Meraih gelar Sarjana\r\n (S1) dari Universitas Padjajaran tahun 1989. Beliau pernah berkarir \r\nmenjadi Kepala Divisi PT Asuransi Takaful Keluarga (1995-1999), Direktur\r\n Teknik PT Asuransi Takaful Umum (2000-2003), Direktur Marketing PT. \r\nAsuransi Takaful Group (2003-2006), dan Asisten Direktur Bank Muamalat \r\nIndonesia (2006-2008). Bergabung dan menjabat sebagai Ketua Dewan \r\nPengawas Syariah PT Reasuransi Nasional Indonesia sejak tahun 2013.', 'dewan_syariah_image/20200207170939DKM__20160816-114727.png', '2020-02-07 10:09:39', '2020-02-07 10:09:39'),
(2, NULL, NULL, 'Dra. Hj. Siti Ma\'rifah, SH, MH', 'Anggota', 'Member', '<p>Lahir di Jakarta, 18 Desember\r\n 1967. Meraih gelar Sarjana (S1) dari STAISA tahun 1990 dan UNKRIS tahun\r\n 1999 serta Pasca Sarjana (S2) dari Universitas Jagakarsa tahun 2002. \r\nSepanjang karirnya, beliau dipercaya menduduki berbagai jabatan \r\ndiantaranya Anggota DPRD Provinsi DKI Jakarta Periode 1999-2004 dan \r\nAnggota DPS PT. Asuransi Panin Life Syariah. Bergabung dan menjabat \r\nsebagai Anggota Dewan Pengawas Syariah PT Reasuransi Nasional Indonesia \r\nsejak tahun 2013.</p>\r\n                          \r\n                        \r\n                        <hr>', '<p>Lahir di Jakarta, 18 Desember\r\n 1967. Meraih gelar Sarjana (S1) dari STAISA tahun 1990 dan UNKRIS tahun\r\n 1999 serta Pasca Sarjana (S2) dari Universitas Jagakarsa tahun 2002. \r\nSepanjang karirnya, beliau dipercaya menduduki berbagai jabatan \r\ndiantaranya Anggota DPRD Provinsi DKI Jakarta Periode 1999-2004 dan \r\nAnggota DPS PT. Asuransi Panin Life Syariah. Bergabung dan menjabat \r\nsebagai Anggota Dewan Pengawas Syariah PT Reasuransi Nasional Indonesia \r\nsejak tahun 2013.</p>\r\n                          \r\n                        \r\n                        <hr>', 'dewan_syariah_image/20200217161209DKM__20161031-130855.jpg', '2020-02-17 09:12:09', '2020-02-17 09:12:09');

