INSERT INTO `m_direksi` (`id`, `title`, `title_en`, `nama`, `jabatan`, `jabatan_en`, `keterangan`, `keterangan_en`, `photo`, `created_at`, `updated_at`) VALUES
(6, NULL, NULL, 'Sunarso, SE, MM, Ak, AAAIK, CSA, CA, CFP, CRMP, CIHRM, CHRP', 'Direktur Keuangan & SDM', 'Director of Finance & HR', 'Kelahiran Jakarta, tanggal 11 Juli 1970. Beliau meraih gelar Sarjana \r\n(S1) Akuntansi dari Universitas Trisakti Jakarta pada tahun 1994 dan \r\nmeraih gelar Program Magister (S2) Studi Manajemen dari Sekolah Tinggi \r\nIlmu Ekonomi Institut Program Wiraswasta Indonesia (STIE IPWI) Jakarta \r\npada tahun 2001. Mengawali karir di industri Asuransi  di PT Asuransi \r\nRaya pada tahun 1994, dan tahun 1995 mulai bergabung dengan PT \r\nReasuransi Nasional Indonesia sebagai Pegawai Pelaksana. Pada tahun 2011\r\n dipercaya sebagai Kepala Divisi Keuangan &amp; Akuntansi, dan pada \r\ntahun 2018 menjadi Kepala Divisi SDM &amp; Umum. Yang terakhir, diangkat\r\n sebagai Direktur Keuangan &amp; SDM dalam Rapat Umum Pemegang Saham \r\nLuar Biasa (RUPSLB) PT Reasuransi Nasional Indonesia pada tanggal 17 \r\nJanuari 2019. Sejak tanggal 03 Agustus 2020 merangkap sebagai Plt Direktur Utama.<br>', 'Born in Jakarta on July 11, 1970. He earned a Bachelor\'s degree in \r\nAccounting from Trisakti University Jakarta in 1994 and earned his \r\nmasters degree in Management Studies from the Indonesia \r\nEntrepreneurship Institute (STIE IPWI) Jakarta in 2001. Started his \r\ncareer in the insurance industry at PT Asuransi Raya in 1994, and began \r\nto join PT Reasuransi Nasional Indonesia in 1995 as a Duty Officer. In \r\n2011 he was entrusted the Division Head of Finance &amp; Accounting, and\r\n in 2018 he became the Division Head of the Human Resources &amp; \r\nGeneral Affairs. Finally, in 2019 he was appointed the Director of \r\nFinance &amp; HR by the Extraordinary General Meeting of Shareholders \r\n(EGM) on January 17, 2019. Since August 3, 2020 concurrently as Acting Prisedent Director<br>', 'direksi_image/20200217160037DKM_20190312-171133.jpg', '2020-08-07 08:52:17', '2020-08-07 08:52:17'),
(7, NULL, NULL, 'Erlan Risdiyanto, SE, ACII, AMII, CRMO, CRGP', 'Direktur Operasi', 'Operational Director', 'Kelahiran Yogyakarta tanggal 23 Juni 1972. Beliau meraih gelar sarjana \r\n(S1) dari Universitas Nasional-Jakarta tahun 1996, karir pertamanya \r\ndirintis sebagai Pegawai Pelaksana Bagian Fire &amp; Engineering Divisi \r\nUnderwriting Facultative di PT Reasuransi Nasional Indonesia pada tahun \r\n2000 dengan jabatan terakhir sebagai Kepala Divisi Underwriting Treaty \r\n&amp; Retrocession pada tahun 2017. Menjabat sebagai Direktur Operasi \r\nsejak 09 Oktober 2017 sampai dengan saat ini.', '<p>Born in Yogyakarta on 23 June 1972. He earned \r\nhis bachelor degree (S1) from National University-Jakarta in 1996, his \r\nfirst career was pioneered as Executive Officer of Fire &amp; \r\nEngineering Underwriting Facultative Division at PT Reasuransi Nasional \r\nIndonesia in 2000 with last position as Head of Underwriting Treaty \r\n&amp; Retrocession Division in 2017. He has served as Operation Director\r\n since October 09, 2017 until now.</p>', 'direksi_image/20200217160123DKM_20171116-100513.jpg', '2020-02-17 09:01:23', '2020-02-17 09:01:23'),
(8, NULL, NULL, 'Fitris Dinarwan, ST, MM, ACII, CRGP', 'Direktur Teknik', 'Technical Director', 'Kelahiran Jakarta tanggal 13 Januari 1975. Beliau meraih gelar sarjana \r\n(S1) dari Institut Teknologi Bandung tahun 1998, dan gelar (S2) dari \r\nUniversitas Indonesia, mengawali karir pertamanya di industri Asuransi \r\nsebagai Management Trainee di PT Reasuransi International Indonesia \r\ntahun (1999  2000), dan diangkat menjadi Kepala Divisi Treaty General \r\nInsurance tahun (2014  2017). Bergabung dan Bertugas di PT Reasuransi \r\nNasional Indonesia menjabat sebagai Direktur Teknik  sejak 09 Oktober \r\n2017 sampai dengan saat ini.', 'Born in Jakarta on 13 January 1975. He graduated from Bandung Institute \r\nof Technology in 1998, and master degree from University of Indonesia, \r\nstarted his first career in the insurance industry as a Management \r\nTrainee at PT Reasuransi International Indonesia (1999 - 2000) , and was\r\n appointed as Head of Treaty General Insurance Division in year (2014 - \r\n2017). Joined and Served at PT Reasuransi Nasional Indonesia as \r\nTechnical Director since October 09, 2017 until now.', 'direksi_image/20200217160317DKM_20171116-100545.jpg', '2020-02-17 09:03:17', '2020-02-17 09:03:17');

