(11, 'Carroll Rittenhouse', 'rittenhouse.carroll78@gmail.com', 'Halo \r\n\r\nPerkenalkan Nama saya Toviq, sales marketing dari ZIPZIP yang merupakan yang merupakan sebuah perusahaan yang khusus memproduksi produk aneka jenis kaos dan merchandise yang berpusat di kota Bandung, Jawa Barat.\r\n\r\nMelalui email ini, saya dan team ingin menawarkan layanan jasa produksi kami untuk produk kaos jersey,totebag,kemeja hingga hijab custom untuk membantu branding perusahaan Anda.\r\nTentunya dengan harga yang lebih MURAH dengan kualitas yang maksimal.\r\n\r\nApakah Anda saat ini sedang mebutuhkan sebuah metode tambahan dalam mempromosikan Bisnis Anda ? \r\nIngin memberikan souvenir kaos keren ke konsumen yang tersablon logo perusahaan Anda, namun masih bingung ingin desain yang seperti apa?\r\natau Anda ingin membuat seragam perusahaan untuk di kenakan di kantor maupun untuk acara GATHERING perusahaan? Atau Anda ingin membuat kaos dengan waktu relatif cepat atau EXPPRESS langsung jadi?\r\n\r\nYa untuk itu kami menghubungi Anda hari ini, karena ZIPZIP siap menjawab semua kebutuhan Anda akan kaos untuk banyak sekali kebutuhan,mulai dari untuk seragam kantor sampai dengan untuk seragam seminar termasuk GOODIE BAGS dan souvenir kainnya.\r\n\r\nKami memiliki workshop di Bandung dengan kelengkapan teknologi sablon cepat dengan tetap menjaga kualitas sablon dan bahan terbaik dengan proses super cepat. \r\n\r\nProduk yang bisa Anda order di ZIPZIP antara lain \":\r\n\r\nJersey Bola, Futsal, Jersey Sepeda hingga jersey motor cross\r\n\r\nTote BAGS\r\nTopi\r\nKemeja seragam\r\nKaos SABLON\r\nHijab Custom\r\n\r\nSemua desain produk ini bisa di sertakan LOGO atau Nama Bisnis Anda untuk meningkatkan VALUE brand yang perusahaan Anda miliki.\r\nPemesanan produk mulai dr kuantiti 1 pcs saja tetap akan kami layani dengan baik.\r\n\r\n\r\nKeuntungan jika Anda mememesan kaos di ZIPZIP antara lain :\r\n\r\n-. Desain kaos selalu GRATIS yang di kerjakan langsung oleh para designer berpengalaman kam